(83, 'You will find only what you bring in.', '2024-10-07 15:15:18.500914', 4.92724, '7a6b839f-fb2b-4cb0-afd6-0ed301e313b6', 'ad62599b-d6d4-4f6d-8d10-42f5d51b8f17'),
(84, 'Luminous beings are we - not this crude matter.', '2024-10-07 15:15:18.530054', 3.24351, '9daf59a8-5e7b-4bfe-abc9-a37070b98f30', '19b3a3a5-6a98-4369-9003-3aa65367cec7'),
(85, 'Already know you that which you need.', '2024-10-07 15:15:18.553054', 4.34251, 'a8d73190-5d0d-4402-9495-1d48a4602566', 'd718454f-4ba7-4ec5-ac5a-823dea8334e6'),
(86, 'Reckless he is. Matters are worse.', '2024-10-07 15:15:18.581278', 3.45046, '36f0182a-5da5-4515-9a6e-1b15a455b890', 'fd310317-af24-4860-8e6e-c844280315c8'),
(87, 'Ready are you? What know you of ready? For eight hundred years have I trained Jedi. My own counsel will I keep on who is to be trained. A Jedi must have the deepest commitment, the most serious mind. This one a long time have I watched. All his life has he looked away - to the future, to the horizon. Never his mind on where he was. Hmm? What he was doing. Hmph. Adventure. Heh. Excitement. Heh. A Jedi craves not these things. You are reckless.', '2024-10-07 15:15:18.605608', 4.48437, '04e6e3a7-1f72-43f2-82cc-e3782fd90235', 'c4ca7064-5038-4b25-ad71-cb9be171fa61'),
(88, 'Always two there are, no more, no less. A master and an apprentice.', '2024-10-07 15:15:18.629403', 2.66128, 'c5746689-025a-4d47-bd50-e14ef162d4c2', '43f9e6fe-58bd-4371-86f3-a5bbc80b0d3b'),
(89, 'Good relations with the Wookiees, I have.', '2024-10-07 15:15:18.658323', 3.62365, '2d8156f3-9d7a-47bb-ac57-048ec6d83ca3', '1206a0ad-c6b5-4e5f-94f4-f85d3d14799b'),
